etar reserva traslado de pasajeros','plugin_custom_transfer_pages' . "\4" . 'Transfer Summary'=>'Resumen traslado pasajeros','plugin_custom_transfer_pages' . "\4" . 'Transfer My reservation'=>'Mi reserva traslado de pasajeros','plugin_custom_transfer_pages' . "\4" . 'Transfer Home Test'=>'Página de inicio traslado de pasajeros','plugin_custom_transfer_pages' . "\4" . 'Transfer Search result'=>'Resultado búsqueda traslado de pasajeros','onboarding_context' . "\4" . 'Loading'=>'Cargando','onboarding_context' . "\4" . 'Click to zoom'=>'Haz un click para hacer zoom','onboarding_context' . "\4" . 'Renting'=>'Alquiler','onboarding_context' . "\4" . 'Search engine or selector'=>'Motor de reserva o selector','onboarding_context' . "\4" . 'Copy the code below and paste on your home page to start the reservation process.'=>'Copia el código que se muestra debajo y pégalo en tu página de inicio para iniciar el proceso de reserva.','onboarding_context' . "\4" . 'Insert this shortcode on your home page:'=>'Inserta este shortcode en tu página web:','onboarding_context' . "\4" . 'Copy shortcode'=>'Copiar el shortcode','onboarding_context' . "\4" . 'Go to the example test page'=>'Ir a la página de ejemplo','onboarding_context' . "\4" . 'Go to the rent example test page'=>'Ir a la página de ejemplo de alquiler','onboarding_context' . "\4" . 'Go to the transfer example test page'=>'Ir a la página de ejemplo de traslado de pasajeros','onboarding_context' . "\4" . 'Calendar'=>'Calendario','onboarding_context' . "\4" . 'The booking calendar is shown automatically in generated pages when you activate the Detail pages option. In case you don\'t, you must create the product pages and insert calendars manually for each of them.'=>'El calendario de reservas se muestra automáticamente en las páginas generadas cuando activas la opción de páginas de detalle. En el caso de no hacerlo, has de crear las páginas de producto e insertar los calendarios de forma manual en ellas. Es la opción que recomendamos si tienes pocos productos.','onboarding_context' . "\4" . 'Copy the shortcodes from your Mybooking account.'=>'Copia los shortcodes de tu cuenta de Mybooking.','onboarding_context' . "\4" . 'How to get the calendar codes'=>'¿Cómo obtener los códigos del calendario?','onboarding_context' . "\4" . 'Planning by days'=>'Planning por días','onboarding_context' . "\4" . 'You can add a schedule that shows availability in a pre-established number of days. This is a purely informative component and can be configured by branch, family and/or product category'=>'Puedes añadir un planning para mostrar la disponibilidad de tu inventario. Se trata de un componente puramente informativo que puede configurarse por sucursal, familia, o producto','onboarding_context' . "\4" . 'Paste this code where you want to show the component:'=>'Pega este código dónde quieras mostrar el componente:','onboarding_context' . "\4" . 'Planning by hours'=>'Planning por horas','onboarding_context' . "\4" . 'You can add a schedule to see the time availability on a selected day. This is a purely informative component and can be configured by branch, family and/or product category'=>'Pudes añadir un planning para ver la disponibilidad en el día seleccionado. Es un componente puramente informativo que puede configurarse por sucursal, familia o producto','onboarding_context' . "\4" . 'Weekly planning'=>'Planning semanal','onboarding_context' . "\4" . 'You can add a weekly schedule with availability to your product page to start the reservation process'=>'Puedes añadir el planning semanal con disponibilidad en tu página de producto para iniciar el proceso de reserva','onboarding_context' . "\4" . 'Shift picker'=>'Selector de turno','onboarding_context' . "\4" . 'You can add a shift selector to start the reservation process. Especially recommended for products or categories with a shift schedule and several units.'=>'Puedes añadir un selector de turnos para iniciar el proceso de reserva. Lo recomendamos para productos que se pueden reservar varias unidades por un turno de unas horas.','onboarding_context' . "\4" . 'Activities'=>'Actividades','onboarding_context' . "\4" . 'Activities catalog'=>'Catálogo de actividades','onboarding_context' . "\4" . 'This component shows a product grid based on your inventory. You can activate buttons and product pages checking Detail pages option on your configuration.'=>'Este componente muestra tu catálogo de productos. Puedes activar el botón para acceder a la página de detalle en la configuración.','onboarding_context' . "\4" . 'Paste this code where you want to show the catalog:'=>'Pega este código dónde quieras mostrar tu catálogo de productos:','onboarding_context' . "\4" . 'The booking calendar is shown automatically when you activate the Detail pages option. In case you don\'t, you must create the product pages and insert calendars manually for each of them.'=>'El calendario de reservas se muestra automáticamente cuando activas la opción de páginas de detalle. En el caso de no hacerlo, has de crear las páginas de producto e insertar los calendarios de forma manual en ellas. Es la opción que recomendamos si tienes pocos productos.','onboarding_context' . "\4" . 'Transfer'=>'Traslado de pasajeros','onboarding_context' . "\4" . 'Dates Selector'=>'Selector de fechas','onboarding_context' . "\4" . 'Is mandatory you copy the code below and paste on your home page or your booking process won\'t work.'=>'Es obligatorio copiar el código que se muestra abajo y pegarlo en tu página web o el proceso de reserva no funcionará.','onboarding_context' . "\4" . 'Paste this code on your home page:'=>'Pega este código en tu página de inicio:','onboarding_context' . "\4" . 'Components could not be recovered for this type of business'=>'No se han podido recuperar componentes para este tipo de negocio','onboarding_context' . "\4" . 'We sorry'=>'Lo sentimos','onboarding_context' . "\4" . 'no component could be recovered'=>'no se ha podido recupera